To edit an object, we need to make it writeable first. In the default state, objects from the Truth are immutable. The Truth API has a function that is called write. When we call it on an object, we make it writable. void modify_my_object(tm_the_truth_o *tt, tm_tt_id_t my_object){ tm_the_truth_object_o *my_object_w = tm_the_truth_api->write(tt, my_object);
//...
