We need to know what kind of property we want to edit. That is why we always want to define our properties in a Header-File. A good practice is to comment on what kind of data type property contains. Let us assume our object is of type TM_TT_TYPE__RECT: enum { TM_TT_PROP__RECT__X, // float TM_TT_PROP__RECT__Y, // float TM_TT_PROP__RECT__W, // float TM_TT_PROP__RECT__H, // float
}; In our example we want to set the width to 100. The width is stored in TM_TT_PROP__RECT__W . When we know what we want to edit, we call the correct function and change the value. The function we need to call: void (*set_float)(tm_the_truth_o *tt, tm_the_truth_object_o *obj, uint32_t property,float value); Let us bring all of this together: void modify_my_object(tm_the_truth_o *tt, tm_tt_id_t my_object){ tm_the_truth_object_o *my_object_w = tm_the_truth_api->write(tt, my_object); tm_the_truth_api->set_float(tt,my_object_w,TM_TT_PROP__RECT__W,100); //...
}

