In the end, we need to commit our change to the system. In this example we do not care about the undo scope. That is why we provide the TM_TT_NO_UNDO_SCOPE define. This means this action is not undoable. void modify_my_object(tm_the_truth_o *tt, tm_tt_id_t my_object){ tm_the_truth_object_o *my_object_w = tm_the_truth_api->write(tt, my_object); tm_the_truth_api->set_float(tt,my_object_w,TM_TT_PROP__RECT__W,100); tm_the_truth_api->commit(tt, my_object_w, TM_TT_NO_UNDO_SCOPE);
} If we wanted to provide a undo scope we need to create one: void modify_my_object(tm_the_truth_o *tt, tm_tt_id_t my_object){ tm_the_truth_object_o *my_object_w = tm_the_truth_api->write(tt, my_object); tm_the_truth_api->set_float(tt,my_object_w,TM_TT_PROP__RECT__W,100); const tm_tt_undo_scope_t undo_scope = tm_the_truth_api->create_undo_scope(tt,"My Undo Scope"); tm_the_truth_api->commit(tt, my_object_w, undo_scope);
} Now this action can be reverted in the Editor.

