Let us add some properties to our Type! As you remember, when we created the Type, the function create_object_type() required a pointer to the definition of properties. You can define properties via the tm_the_truth_property_definition_t struct. typedef struct tm_the_truth_property_definition_t
{ // Name of the property, e.g. "cast_shadows". // // This name is used both for serialization and for the UI of editing the property. When // displayed in the UI, the name will be automatically capitalized (e.g. "Cast Shadows"). // // The name shouldn't be longer than [[TM_THE_TRUTH_PROPERTY_NAME_LENGTH]] characters. const char *name; // [[enum tm_the_truth_property_type]] type of the property. uint32_t type; // [[enum tm_the_truth_editor]] enum defining what editor should be used for editing the property. uint32_t editor; // Editor specific settings. union { tm_the_truth_editor_enum_t enum_editor; tm_the_truth_editor_string_open_path_t string_open_path_editor; tm_the_truth_editor_string_save_path_t string_save_path_editor; }; // For properties referring to other objects (references & subobjects), specifies the type of // objects that they can refer to. A value of [[TM_TT_TYPE__ANYTHING]] is used for an object // that can refer to anything. // // Note: We currently don't have any system for representing "interfaces" or groups of types. // I.e. you can't say "I want this to reference any type that inherits from the GRAPH_NODE_TYPE, // but no other types." We may add this in the future. tm_strhash_t type_hash; // Specifies that the property is allowed to refer to other types than the `type_hash`. // // !!! NOTE: Note // This flag should not be used going forward. Instead, if a property can refer to multiple // types, you should use a `type_hash` of [[TM_TT_TYPE__ANYTHING]]. It is provided for // compatibility purposes, because some object types have a `type_hash` specified but // store subobjects of other types. We cannot simply change the `type_hash` of those objects // to [[TM_TT_TYPE__ANYTHING]], because there may be saved data that has serialized versions // of those objects that omits the object type (if it is `type_hash`). We can't deserialize // those objects if we don't know the `type_hash` of the type. bool allow_other_types; TM_PAD(7); // For buffer properties, the extension (if any) used to represent the buffer type. This can // either be hard-coded in `buffer_extension`, or computed by the `buffer_extension_f()` // callback (set the unused option to `NULL`). const char *buffer_extension; const char *(*buffer_extension_f)(const tm_the_truth_o *tt, tm_tt_id_t object, uint32_t property); // Tooltip used to describe the property in more detail. The tooltip text will be displayed in // the property editor when the property is hovered over. // // The tooltip should be registered using [[TM_LOCALIZE_LATER()]]. It will be dynamically // localized to the current interface language with [[TM_LOCALIZE_DYNAMIC()]] before being // displayed in the UI. const char *tooltip; // If *true*, this property will be skipped during serialization. bool not_serialized; TM_PAD(7); // If specified, this will be used instead of `name` for the UI. const char *ui_name;
} tm_the_truth_property_definition_t; ( API Documentation ) Within our create_truth_types we create a array of type tm_the_truth_property_definition_t . For this example, we define the properties of type bool and string. // include [macros.h](https://ourmachinery.com/apidoc/foundation/macros.h.html#macros.h) to access TM_ARRAY_COUNT for convinace:
#include <foundation/macros.h>
//..code
void create_truth_types(tm_the_truth_o *tt){ tm_the_truth_property_definition_t properties[] = { { "my_bool", TM_THE_TRUTH_PROPERTY_TYPE_BOOL }, { "my_string", TM_THE_TRUTH_PROPERTY_TYPE_STRING }, }; tm_the_truth_api->create_object_type(tt, TM_TT_TYPE__MY_TYPE, properties,TM_ARRAY_COUNT(properties);
} That is all we need to do to define properties for our Type! Also thanks to our automatic "reflection" system you do not have to worry about providing a UI for the type. The Properties View will automatically provide a UI for this type.

122.body:
The Machinery is organized into individual APIs that can be called to perform specific tasks. A plugin is a DLL that exposes one or several of these APIs. In order to implement its functionality, the plugin may in turn rely on APIs exposed by other plugins. A central object called the API registry is used to keep track of all the APIs. When you want to use an API from another plugin, you ask the API registry for it. Similarly, you expose your APIs to the world by registering them with the API registry. This may seem a bit abstract at this point, so let’s look at a concrete example, unicode.h which exposes an API for encoding and decoding Unicode strings: // This header has been abridged and commented from the original to make things
// clearer. // Include standard header.
#include "api_types.h" // Forward declarations.
struct tm_temp_allocator_i; // Name of this API in the registry.
#define TM_UNICODE_API_NAME "tm_unicode_api" // Unicode helper functions.
struct tm_unicode_api
{ // Encodes the `codepoint` as UTF-8 into `utf8` and returns a pointer to the // position where to insert the next codepoint. `utf8` should have room for at // least four bytes (the maximum size of a UTF-8 encoded codepoint). char *(*utf8_encode)(char *utf8, uint32_t codepoint); // Decodes and returns the first codepoint in the UTF-8 string `utf8`. The string // pointer is advanced to point to the next codepoint in the string. Will generate // an error message if the string is not a UTF-8 string. uint32_t (*utf8_decode)(const char **utf8); // ...
}; Let’s go through this. First, the code includes <api_types.h>. This is a shared header with common type declarations, it includes things like <stdbool.h> and <stdint.h> and also defines a few The Machinery specific types, such as tm_vec3_t. In The Machinery we have a rule that header files can't include other header files (except for <api_types.h>). This helps keep compile times down, but it also simplifies the structure of the code. When you read a header file you don’t have to follow a long chain of other header files to understand what is happening. Next follows a block of forward struct declarations (in this case only one). Next, we have the name of this API defined as a constant TM_UNICODE_API_NAME , followed by the struct tm_unicode_api that defines the functions in the API. To use this API, you would first use the API registry to query for the API pointer, then using that pointer, call the functions of the API: struct tm_unicode_api *tm_unicode_api = (struct tm_unicode_api *)tm_global_api_registry->get(TM_UNICODE_API_NAME); tm_unicode_api->utf8_encode(utf8, codepoint); The different APIs that you can query for and use are documented in their respective header files, and in the apidoc.md.html documentation file (which is just extracted from the headers). Consult these files for information on how to use the various APIs that are available in The Machinery. In addition to APIs defined in header files, The Machinery also contains some header files with inline functions that you can include directly into your implementation files. For example <math.inl> provides common mathematical operations on vectors and matrices, while <carray.inl> provides a “stretchy-buffer” implementation (i.e. a C version of C++’s std::vector).

