Every plugin has tm_load_plugin() as its entry point, in there we register everything we need to register to the Engines Plugin System. It is important that you do not execute heavy code in this function or relay on other plugins, since they might not be loaded yet! This function is just there to perform load and register operations. Where does my gameplay code live? Your gameplay lives within the Systems / Engines of the ECS or in the Simulate Entry and they have their own entry points. How do I update my tool / tab content? The tm_tab_vt defines three functions for your tab to be updated: tm_tab_vt.ui() - Callback for drawing the content of the tab into the specified rect. tm_tab_vt.ui_serial() - Optional. If implemented, called from the main UI job once all parallel UI rendering (fork/join) has finished. This can be used for parts of the UI that needs to run serially, for example because they call out to non-thread-safe function. tm_tab_vt.hidden_update() - Optional . If the tab wants to do some processing when it is not the selected tab in its tabwell, it can implement this callback. This will be called for all created tabs whose content is currently not visible. For more information follow the "Write a tab" walkthrough. Plugin callbacks (Init, Sutdown, Tick) The plugin system provides also for plugin callbacks. It is recommended to rely on these calls as little as possible. You should not rely on those for your gameplay code! TM_PLUGIN_INIT_INTERFACE_NAME - Is typically called as early as possible after all plugins have been loaded. Note: It is not called when a plugin is reloaded. TM_PLUGIN_SHUTDOWN_INTERFACE_NAME - Is typically be called as early as possible during the application shutdown sequence Note: Is not called when a plugin is reloaded. TM_PLUGIN_TICK_INTERFACE_NAME - Is typically called as early as possible in the application main loop “tick”. They are stored in the foundation/plugin_callbacks.h. How do I deal with static variables? The use of static variables in DLLs can be problematic, because when the DLL is reloaded, the new instance of the DLL will get a new freshly initialized static variable, losing whatever content the variable had before reload. The tm_api_registry_api provides a way to solve this issue: tm_api_registry_api.static_variable() By using this function instead of defining it globally, the variable data is saved in permanent memory. uint64_t *count_ptr; TM_DLL_EXPORT void tm_load_plugin(struct tm_api_registry_api *reg, bool load)
{ count_ptr = (uint64_t *)reg->static_variable(TM_STATIC_HASH("my_count", 0xa287d4b3ec9c2109ULL), sizeof(uint64_t), __FILE__, __LINE__);
} void f()
{ ++*count_ptr;
}

