You can also create your own APIs that other plugins can query for. If you create your own APIs, you want to define them in your header file, so that other plugins can #include it and know how to call your APIs. Note that if you are not defining your own APIs, but just implementing some of the engine's ones, your plugin typically doesn't need a header file: my_plugin.h: #include "foundation/api_types.h" #define MY_API_NAME "my_api" struct my_api
{ void (*foo)(void);
}; my_plugin.c: static struct tm_api_registry_api *tm_global_api_registry;
static struct tm_error_api *tm_error_api;
static struct tm_logger_api *tm_logger_api; #include "my_plugin.h" #include "foundation/api_registry.h"
#include "foundation/error.h"
#include "foundation/log.h"
#include "foundation/unit_test.h" static void foo(void)
{ // ...
} static struct my_api *my_api = &(struct my_api) { .foo = foo,
}; static void my_unit_test(tm_unit_test_runner_i *tr, struct tm_allocator_i *a)
{ // ...
} static struct tm_unit_test_i *my_unit_test = &(struct tm_unit_test_i) { .name = "my_api", .test = my_unit_test,
}; TM_DLL_EXPORT void tm_load_plugin(struct tm_api_registry_api *reg, bool load)
{ tm_global_api_registry = reg; tm_error_api = reg->get(TM_ERROR_API_NAME); tm_logger_api = reg->get(TM_LOGGER_API_NAME); tm_set_or_remove_api(reg, load, MY_API_NAME, my_api); tm_add_or_remove_implementation(reg, load, TM_UNIT_TEST_INTERFACE_NAME, my_unit_test);
} When The Machinery loads a plugin DLL, it looks for the tm_load_plugin() function and calls it. If it can't find the function, it prints an error message. We store the API registry pointer in a static variable so that we can use it everywhere in our DLL. We also get() some of the API pointers that we will use frequently and store them in static variables so that we don’t have to use the registry to query for them every time we want to use them. Finally, we add our own API to the registry, so others can query for and use it.

