In this example, we want to create a new plugin, which contains our Tab. We open the Engine go to file -> New Plugin -> Editor Tab. The file dialog will pop up and ask us where we want to save our file. Pick a location that suits you. Tip: Maybe store your plugin in a folder next to your game project. After this, we see that the Engine created some files for us. folder structure new plugin Now we need to ensure that we can build our project. In the root folder (The folder with the premake file), we can run tmbuild and see if there is no issue. We will build our projects once and generate the .sln file (on windows). If there is an issue, we should ensure we have set up the Environment variables correctly and installed all the needed dependencies. For more information, please read this guide . Now we can open the .c file with our favorite IDE. The file will contain the following content: static struct tm_api_registry_api* tm_global_api_registry; static struct tm_draw2d_api* tm_draw2d_api;
static struct tm_ui_api* tm_ui_api; #include <foundation/allocator.h>
#include <foundation/api_registry.h> #include <plugins/ui/docking.h>
#include <plugins/ui/draw2d.h>
#include <plugins/ui/ui.h>
#include <plugins/ui/ui_custom.h> #include <the_machinery/the_machinery_tab.h> #include <stdio.h> TM_DLL_EXPORT void load_custom_tab_tab(struct tm_api_registry_api* reg, bool load); #define TM_CUSTOM_TAB_VT_NAME "tm_custom_tab"
#define TM_CUSTOM_TAB_VT_NAME_HASH TM_STATIC_HASH("tm_custom_tab", 0xbc4e3e47fbf1cdc1ULL) struct tm_tab_o { tm_tab_i tm_tab_i; tm_allocator_i* allocator;
}; static void tab__ui(tm_tab_o* tab, tm_ui_o* ui, const tm_ui_style_t* uistyle_in, tm_rect_t rect)
{ tm_ui_buffers_t uib = tm_ui_api->buffers(ui); tm_ui_style_t* uistyle = (tm_ui_style_t[]){ *uistyle_in }; tm_draw2d_style_t* style = &(tm_draw2d_style_t){ 0 }; tm_ui_api->to_draw_style(ui, style, uistyle); style->color = (tm_color_srgb_t){ .a = 255, .r = 255 }; tm_draw2d_api->fill_rect(uib.vbuffer, *uib.ibuffers, style, rect);
} static const char* tab__create_menu_name(void)
{ return "Custom Tab";
} static const char* tab__title(tm_tab_o* tab, struct tm_ui_o* ui)
{ return "Custom Tab";
} static tm_tab_i* tab__create(tm_tab_create_context_t* context, tm_ui_o *ui)
{ tm_allocator_i* allocator = context->allocator; uint64_t* id = context->id; static tm_the_machinery_tab_vt* vt = 0; if (!vt) vt = tm_global_api_registry->get(TM_CUSTOM_TAB_VT_NAME); tm_tab_o* tab = tm_alloc(allocator, sizeof(tm_tab_o)); *tab = (tm_tab_o){ .tm_tab_i = { .vt = (tm_tab_vt*)vt, .inst = (tm_tab_o*)tab, .root_id = *id, }, .allocator = allocator, }; *id += 1000000; return &tab->tm_tab_i;
