}; TM_DLL_EXPORT void tm_load_plugin(struct tm_api_registry_api* reg, bool load)
{ tm_global_api_registry = reg; tm_draw2d_api = reg->get(TM_DRAW2D_API_NAME); tm_ui_api = reg->get(TM_UI_API_NAME); tm_set_or_remove_api(reg, load, TM_CUSTOM_TAB_VT_NAME, custom_tab_vt); tm_add_or_remove_implementation(reg, load, TM_TAB_VT_INTERFACE_NAME, custom_tab_vt);
}

