As mentioned before, the data of a tab is bound to its lifetime. Therefore you should create the data on create and let go of it on destroy. The create function provides you the tm_tab_create_context_t access to many essential things, such as an allocator. This allocator is the one you should use directly or create a child allocator. Note: for more information check tm_tab_create_context_t 's documentation. static tm_tab_i* tab__create(tm_tab_create_context_t* context, tm_ui_o *ui)
{ tm_allocator_i* allocator = context->allocator; static tm_the_machinery_tab_vt* vt = 0; if (!vt) vt = tm_global_api_registry->get(TM_CUSTOM_TAB_VT_NAME); tm_tab_o* tab = tm_alloc(allocator, sizeof(tm_tab_o)); *tab = (tm_tab_o){ .tm_tab_i = { .vt = (tm_tab_vt*)vt, .inst = (tm_tab_o*)tab, .root_id = *id, }, .allocator = allocator, }; return &tab->tm_tab_i;
} As you can notice, we ask the tm_global_api_registry_api if our Tab is already registered. If yes, we use the static local variable. If not, we get it from the registry. static tm_the_machinery_tab_vt* vt = 0; if (!vt) vt = tm_global_api_registry->get(TM_CUSTOM_TAB_VT_NAME); After this, we use the provided allocator to allocate the Tab struct, and then we initialize it with the data we deem to be needed. tm_tab_o* tab = tm_alloc(allocator, sizeof(tm_tab_o)); *tab = (tm_tab_o){ .tm_tab_i = { .vt = (tm_tab_vt*)vt, .inst = (tm_tab_o*)tab, .root_id = *id, }, .allocator = allocator, }; Since we have allocated something, we need to keep track of the used allocator! Hence we have it as a member in our Tab struct. In the end, we pass a pointer to the Tab interface. return &tab->tm_tab_i; When it comes to free the Tab data, we can just call tm_free() on our Tab: static void tab__destroy(tm_tab_o* tab)
{ tm_free(tab->allocator, tab, sizeof(*tab));
}

