You an register a component to the TM_ENTITY_SIMULATION_REGISTER_ENGINES_INTERFACE_NAME in your plugin load function. This interface expects a function pointer to a create component function of the signature: void tm_entity_register_engines_i(struct tm_entity_context_o *ctx). The function itself looks as follows: static void component__register_engine(struct tm_entity_context_o* ctx)
{ const tm_component_type_t custom_component = tm_entity_api->lookup_component_type(ctx, TM_TT_TYPE_HASH__CUSTOM_COMPONENT); const tm_component_type_t transform_component = tm_entity_api->lookup_component_type(ctx, TM_TT_TYPE_HASH__TRANSFORM_COMPONENT); const tm_engine_i custom_component_engine = { .ui_name = "Custom Component", .hash = TM_STATIC_HASH("CUSTOM_COMPONENT", 0xe093a8316a6c2d29ULL), .num_components = 2, .components = { custom_component, transform_component }, .writes = { false, true }, .update = engine_update__custom_component, .filter = engine_filter__custom_component, .inst = (tm_engine_o*)ctx, }; tm_entity_api->register_engine(ctx, &custom_component_engine);
} The first thing we do is looking up the component type. Did we register the type? If not, we will not get the correct type. Here we are using the name we defined beforehand in our component create function. Then we ask for the transform component next because our Engine shall run on those two components. After this, we define the actual instance of our engine struct tm_engine_i . We provide a .ui_name used in the Profiler to identify our Engine. Moreover, we add a unique string hash identifying this engine/system. This is used for scheduling the engine/system concerning other engines and systems, using thebefore_me and after_me fields. Then we tell the system how many components the Engine shall operate on and which ones we will modify. This is used for scheduling the engines later one. At last, we provide the needed update function, which we have discussed earlier, and a filter function. static bool engine_filter__custom_component(tm_engine_o* inst, const tm_component_type_t* components, uint32_t num_components, const tm_component_mask_t* mask)
{ return tm_entity_mask_has_component(mask, components[0]) && tm_entity_mask_has_component(mask, components[1]);
} The filter function will be called on all entity types to determine if the Engine shall run on them or not. To provide this function is optional. If present it specifies a filter function called for each entity type (as represented by its component mask) to determine if the Engine should run on that entity type. If no tm_engine_i.filter() function is supplied and no excludes[] flags are set, the update will run on entity types that have all the components in the components array. If some excludes[] flags are set, the Engine will run on all entity types that do not have any of the components whose excludes[] flags are set, but have all the other components in the components array. Note: For more information, check the documentation . The last thing the register function needs to do is register the Engine to the Entity Context. tm_entity_api->register_engine(ctx, &custom_component_engine);

