- Component A
- Component B
- Component C
#2 Entity:
- Component A
- Component B
- Component D Now we have a Engine that shall operate on (Component A,Component B) but we do not want it to operate on entities with Component D we could just check in our update loop: // Runs on (component a, comnponent b)
static void engine_update__custom_component(tm_engine_o* inst, tm_engine_update_set_t* data)
{ struct tm_entity_context_o* ctx = (struct tm_entity_context_o*)inst;
// code for (tm_engine_update_array_t* a = data->arrays; a < data->arrays + data->num_arrays; ++a) {
//.. code for (uint32_t i = 0; i < a->n; ++i) { // if the entity has no component it returns a NULL pointer if(!tm_entity_api->get_component_by_hash(ctx,a->entities[i],TM_TYPE_HASH__COMPONENT_D)){ //..code } } }
