{ tm_component_i component = (tm_component_i){ .name = TM_TT_TYPE__PLAYER_NO_MOVE_TAG_COMPONENT, .bytes = sizeof(uint64_t), // since we do not care of its content we can just pick any 8 byte type }; tm_entity_api->register_component(ctx, &component);
