{ // code .. for (tm_engine_update_array_t *a = data->arrays; a < data->arrays + data->num_arrays; ++a) { // code... for (uint32_t x = 0; x < a->n; ++x) { // code... if(player_should_not_walk_anymore){ tm_entity_api->add_component(ctx, d->entities[i], no_movement); } } }
} As you an see the Movement Engine will now update all other entities in the game which do not have the No Movement Tag.

