Before we can build any project, we need to set up our environment. You need to set the following environment variable: (If this one has not been set the tool will not be able to build) TM_SDK_DIR - This is the path to find the folder headers and the folder lib If the following variable is not set, the tool will assume that you intend to use the current working directory: TM_LIB_DIR - The folder which determines where to download and install all dependencies (besides the build environments) How to add environment variables? Windows On Windows all you need to do is you need to add the folder where you installed The Machinery to your environment variables. You can do this like this: Start > Edit the system environment variables > environment variables > system varaibles > click New... > add TM_SDK_DIR or TM_LIB_DIR as the Variable Name and the needed path as the Variable Value. Close and restart the terminal or Visual Studio / Visual Studio Code. As an alternative, you can set an environment variable via PowerShell before you execute tmbuild, which will stay alive till the end of the session: $Env:TM_SDK_DIR="..PATH" Debian/Ubuntu Linux You open the terminal or edit with your favorite text editor ~/.bashrc and you add the following lines: #...
export TM_SDK_DIR=path/to/themachinery/
export TM_LIB_DIR=path/to/themachinery/libs (e.g. via nano nano ~/.bashrc)

